import { Route } from '@angular/router';

import { CalendarComponent } from './calendar.component';

export const CALENDAR_ROUTE: Route = {
  path: '',
  component: CalendarComponent,
  data: {
    pageTitle: 'routes.calendar.title'
  }
};
